var imageLoader = require("../../utils/load_images.js");

Page({
  data: {
    showErrorMsg: false,
  },

  onShow:function(){
  },

  onReady: function(){
    var page = this;

    // worker.onMessage(function (res) {
    //   console.log("页面接收到消息:", res);
    //   if(res.error){
    //     wx.showModal({
    //       title: "温馨提示",
    //       content: res.error,
    //       showCancel: false
    //     });
    //   }else{
    //     wx.redirectTo({
    //       url: '/faceoff/pages/index/index'
    //     });
    //   }
    // });

    getApp().index = this;

    getApp().globalData.FILE_DATA = wx.base64ToArrayBuffer('');

    imageLoader.loadImages(function(data){
      var allImageList = data.reverse();
      var idx = 0;
      var list0 = [];
      var list1 = [];
      //平均分配到两列中
      while (allImageList.length > 0) {
        var img = allImageList.pop();
        if (idx % 2 == 0) {
          list0.push(img);
        } else {
          list1.push(img);
        }
        idx += 1;
      }
      getApp().globalData.imageListCol0 = list0;
      getApp().globalData.imageListCol1 = list1;
      wx.redirectTo({
        url: '/faceoff/pages/index/index'
      });
    });
  },
})
